import logo from './logo.svg';
import './App.css';
import * as http from "util/HttpClient";

function App() {
  function getStockRecommendList() {
    const url = `http://localhost:8080`
    const method = 'post'
    const data = {
      "featureStockUid": 0,
      "listCnt": 0,
      "pubAnnounceUid": 0,
      "recStockUid": 0,
      "searchKeyword": "string",
      "startIndex": 0,
      "themeStockUid": 0,
      "userLevel": "string"
    }
    console.log(url)
    const response = http.request(url, method, data)
    console.log(response)
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
